export const GET_NAME = "GET_NAME";
export const GET_EMAIL = "GET_EMAIL";
export const GET_AGE = "GET_AGE";

export const getName = (change_Name) => ({ type: GET_NAME, change_Name });
export const getEmail = (change_Email) => ({ type: GET_EMAIL, change_Email });
export const getAge = (change_Age) => ({ type: GET_AGE, change_Age });
